(7, 18, '2015-10-05 09:58:05', 'Intro', 'युनाइटेड इन्स्योरेन्स कं. (नेपाल) लिमिटेड एक आई एस ओ ९००१ः२००० बाट प्रमाणित निर्जिवन बीमा कम्पनी हो । कम्पनी रजिष्ट्रारको कार्यालयमा दर्ता &amp;nbsp;तथा बीमा समितिको इजाजत पत्र लिई &amp;nbsp;मिति २०५० साल मंसिर १६ गतेबाट यस कम्पनीले आफ्नो &amp;nbsp;कारोवार शुरु गरेको हो । विशिष्ठ अद्योगपति, व्यापारिक समुह, नेपाल औद्योगिक विकास निगम तथा ठूलो संख्यामा सर्वसाधारण व्यक्तिहरुको संलग्नता रहेको यस कम्पनीको हाल ५० करोड &amp;nbsp;अधिकृत पूजिँ तथा जारी पूजिँ ३० करोड २४ लाख &amp;nbsp;र चुक्ता पूजिँ &amp;nbsp;३० करोड २४ लाख &amp;nbsp;रहेको छ ।&amp;nbsp;&lt;/p&gt;\r\n', '', 'Published', 'intro-561e345f14e9c', 'Public', '', 'Nepali'),
(8, 18, '2015-10-05 09:58:26', 'पोर्टफोलियो', '', '', 'Published', '561249c2d34ef', 'Public', '', 'Nepali');
