(13, 18, '2015-10-02 06:17:33', 'Citizen\'s Charter', '&lt;table border=&quot;0&quot; cellpadding=&quot;0&quot; cellspacing=&quot;0&quot; class=&quot;table table-bordered table-hover table-striped&quot; style=&quot;width:100%&quot;&gt;\r\n	&lt;tbody&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&lt;strong&gt;Company&amp;#39;s Services&lt;/strong&gt;&lt;/td&gt;\r\n			&lt;td&gt;All services related to Non-Life Insurance&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&lt;strong&gt;Related Rules and Laws&lt;/strong&gt;&lt;/td&gt;\r\n			&lt;td&gt;Company Act 2063; Insurance Act 2049; Insurance Rules and Regulations 2049; and other related Laws and Acts, including rules and regulations circulars issued by Beema Samiti.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&lt;strong&gt;Underwriting&lt;/strong&gt;\r\n			&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n			&lt;/td&gt;\r\n			&lt;td&gt;Know Your Customer (KYC) Form along with Photo Copy of Citizenship, One PP Size Photo, PAN/Registration Paper (for Firm) is a must for all Insurance.\r\n			&lt;p&gt;&lt;strong&gt;Required document for Insurance:&amp;nbsp;&lt;/strong&gt;&lt;/p&gt;\r\n\r\n			&lt;ol&gt;\r\n				&lt;li&gt;All types of Insurance : Proposal Form&lt;/li&gt;\r\n				&lt;li&gt;Vehicle Insurance : Vehicle Registration Booklet (Blue Book), renewal notice issued from previous insurance company (if any).&lt;/li&gt;\r\n				&lt;li&gt;Marine Insurance : Letter of Credit (L/C), Invoice, Pro-forma Invoice.&lt;/li&gt;\r\n				&lt;li&gt;Contractor&amp;#39;s All Risk : Contract Document, Bill of Quantity (BOQ)&lt;/li&gt;\r\n				&lt;li&gt;Travel Medical Insurance : Copy of Passport&lt;/li&gt;\r\n				&lt;li&gt;Other Insurances: As required by the company&lt;/li&gt;\r\n			&lt;/ol&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&lt;strong&gt;Required time to prepare Insurance Policy&lt;/strong&gt;&lt;/td&gt;\r\n			&lt;td&gt;Maximum an hour, after receiving proposal form, along with necessary documents.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&lt;strong&gt;Premium (charges) to be paid&amp;nbsp;&lt;/strong&gt;&lt;/td&gt;\r\n			&lt;td&gt;The total Premium includes fees as declared in Insurance Policy/Tax Invoice, stamp fee and VAT.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&lt;strong&gt;Renewal Notice&lt;/strong&gt;&lt;/td&gt;\r\n			&lt;td&gt;For one year policy company shall send renewal notice with required premium before one month of the policy expiry to the address provided in the proposal form.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&lt;strong&gt;Underwriting related complaints&amp;nbsp;&lt;/strong&gt;&lt;/td&gt;\r\n			&lt;td&gt;At the Company&amp;#39;s Head Office&lt;br /&gt;\r\n			First : Mr. &lt;!--StartFragment--&gt;Dibash Timalsina, Asst. Manager&lt;!--EndFragment--&gt;&lt;br /&gt;\r\n			Second : &lt;!--StartFragment--&gt;Mr.Bibek Pathak Sr. Manager&lt;!--EndFragment--&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&lt;strong&gt;Where to claim&lt;/strong&gt;&lt;/td&gt;\r\n			&lt;td&gt;Claim Department of Head Office and/or any branch offices or email at uic@mail.com.np&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&lt;strong&gt;Time Consume&lt;/strong&gt;&lt;/td&gt;\r\n			&lt;td&gt;Within two weeks after receiving complete documents i.e. Surveyors&amp;#39; Report, completed claim form and other essential documents&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&lt;strong&gt;Claim related complaint&lt;/strong&gt;&lt;/td&gt;\r\n			&lt;td&gt;At the Company&amp;#39;s Head Office&lt;br /&gt;\r\n			Mr. Prashant Raj Neupane, Asst. Manager&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&lt;strong&gt;Share&lt;/strong&gt;.&lt;/td&gt;\r\n			&lt;td&gt;Company&amp;#39;s share issues is handled by M/S. NMB Capital Limited Naxal, Kathmandu&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&lt;strong&gt;Complain&lt;/strong&gt;&lt;/td&gt;\r\n			&lt;td&gt;At the Company&amp;#39;s Head Office&lt;br /&gt;\r\n			&lt;!--StartFragment--&gt;Mr. Bidur Bahadur Bhujel&lt;!--EndFragment--&gt;, &lt;!--StartFragment--&gt;Company Secretary&lt;!--EndFragment--&gt;&amp;nbsp;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n	&lt;/tbody&gt;\r\n&lt;/table&gt;\r\n', '', 'Published', 'Allow', 1, 'citizen-s-charter', 6, 'Public', '', 0, ''),
(16, 18, '2015-10-02 06:18:30', 'Motor Insurance', '&lt;p&gt;UICL provides two types of policies in this insurance:&lt;/p&gt;\r\n\r\n&lt;p&gt;1. (i)&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;strong&gt;Comprehensive&amp;nbsp;&lt;/strong&gt;- includes any loss or damage to the vehicle by: -&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:94.5pt&quot;&gt;(a) Accidental external means&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:94.5pt&quot;&gt;(b) Fire, external explosion, self-ignition, lightning, burglary, house- breaking or theft.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:94.5pt&quot;&gt;(c) Malicious act&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:94.5pt&quot;&gt;(d) Whilst in transit by road, rail, inland waterway, lift or elevator, and;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:1.0in&quot;&gt;(ii) &amp;nbsp;&amp;nbsp; The insured&amp;#39;s liabilities to third party both in respect of bodily injury and properties of the third party.&lt;/p&gt;\r\n\r\n&lt;p&gt;2.&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;strong&gt;Third party&lt;/strong&gt; liability restricted to the liability described in (ii) above and not the insured&amp;#39;s vehicle, the policy can be extended to cover the following perils on payment of additional premium: Flood, Earthquake, Strike, Riot Damage etc.&lt;/p&gt;\r\n\r\n&lt;p&gt;-Mototcycle&lt;br /&gt;\r\n-Private Vehicle&lt;br /&gt;\r\n-Commercial&amp;nbsp;Vehicle&lt;/p&gt;\r\n\r\n&lt;table class=&quot;table&quot;&gt;\r\n	&lt;thead&gt;\r\n		&lt;tr&gt;\r\n			&lt;th&gt;S.No.&lt;/th&gt;\r\n			&lt;th&gt;Title&lt;/th&gt;\r\n			&lt;th&gt;Explanation&lt;/th&gt;\r\n		&lt;/tr&gt;\r\n	&lt;/thead&gt;\r\n	&lt;tbody&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;1&lt;/td&gt;\r\n			&lt;td&gt;Vehicle Type&lt;/td&gt;\r\n			&lt;td&gt;Motorcycle, Private, Commercial and others&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;2&lt;/td&gt;\r\n			&lt;td&gt;Detail of Vehicle&lt;/td&gt;\r\n			&lt;td&gt;Detail of vehicles: CC/ Horse Power / Ton, Chasis No., Engine No.,&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;Model, Make of Year, Seats, Registration No&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;3&lt;/td&gt;\r\n			&lt;td&gt;Period of&lt;/td&gt;\r\n			&lt;td&gt;Time limit for Insurance&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;Insurance&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;4&lt;/td&gt;\r\n			&lt;td&gt;Sum Insured&lt;/td&gt;\r\n			&lt;td&gt;Dealer&amp;#39;s Market Price (in case of new)&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;Depreciated value as per instruction of Insurance Board (in case of old)&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;5&lt;/td&gt;\r\n			&lt;td&gt;Discount on&lt;/td&gt;\r\n			&lt;td&gt;Corporate&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;Premium&lt;/td&gt;\r\n			&lt;td&gt;EOD = Excess Own Damage&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;No Claim Discount from the second year&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;Own Goods Carrying in commercial vehicle&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;6&lt;/td&gt;\r\n			&lt;td&gt;Additional Risks&lt;/td&gt;\r\n			&lt;td&gt;Riot strike damage, Malicious damage, terrorism, driver risk,&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;passenger risk, etc.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;7&lt;/td&gt;\r\n			&lt;td&gt;Others&lt;/td&gt;\r\n			&lt;td&gt;KYC, Signature, etc.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n	&lt;/tbody&gt;\r\n&lt;/table&gt;\r\n\r\n&lt;p&gt;&lt;!--StartFragment--&gt;&lt;strong&gt;Started from 1st December 1993&lt;/strong&gt;&lt;!--EndFragment--&gt;&amp;nbsp;&lt;/p&gt;\r\n', '', 'Published', 'Allow', 2, 'motor-insurance', 3, 'Public', '', 0, '/insurance-in-nepal/upload/images/motorinsurance.jpg'),
(17, 18, '2015-10-02 06:18:45', 'Marine Cargo Insurance', '&lt;p&gt;UICL provides Marine Cargo Insurance for overseas &amp;amp; in land transit of goods whilst in transit by Ship, Air, Rail or Road. &amp;nbsp;This insurance can also be extended to cover all risks of malicious act as per the institute cargo clauses.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Marine Cargo&lt;/li&gt;\r\n	&lt;li&gt;Inland Transit&lt;/li&gt;\r\n	&lt;li&gt;Overseas Transit&lt;/li&gt;\r\n	&lt;li&gt;Air&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;table class=&quot;table&quot;&gt;\r\n	&lt;thead&gt;\r\n		&lt;tr&gt;\r\n			&lt;th&gt;S.No.&lt;/th&gt;\r\n			&lt;th&gt;Title&lt;/th&gt;\r\n			&lt;th&gt;Explanation&lt;/th&gt;\r\n			&lt;th&gt;&amp;nbsp;&lt;/th&gt;\r\n			&lt;th&gt;&amp;nbsp;&lt;/th&gt;\r\n		&lt;/tr&gt;\r\n	&lt;/thead&gt;\r\n	&lt;tbody&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;1&lt;/td&gt;\r\n			&lt;td&gt;Name&lt;/td&gt;\r\n			&lt;td&gt;Name of Consigner &amp;amp; Address&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;Name of Consignee &amp;amp; Address&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;2&lt;/td&gt;\r\n			&lt;td&gt;Detail of Goods&lt;/td&gt;\r\n			&lt;td&gt;Nature of goods&lt;/td&gt;\r\n			&lt;td&gt;Quantity&lt;/td&gt;\r\n			&lt;td&gt;Packing&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;Invoice value/no/date&lt;/td&gt;\r\n			&lt;td&gt;Currency&lt;/td&gt;\r\n			&lt;td&gt;Sum Insured&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;Voyage&lt;/td&gt;\r\n			&lt;td&gt;Risk coverage&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;Date of departure&lt;/td&gt;\r\n			&lt;td&gt;Mode of transportation&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;L/C no/date&lt;/td&gt;\r\n			&lt;td&gt;Excess&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;3&lt;/td&gt;\r\n			&lt;td&gt;Discount on&lt;/td&gt;\r\n			&lt;td&gt;Corporate/Agency&lt;/td&gt;\r\n			&lt;td&gt;Air Transit&lt;/td&gt;\r\n			&lt;td&gt;Bulk Sum Insured&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;Premium&lt;/td&gt;\r\n			&lt;td&gt;Distance of Land Transit&lt;/td&gt;\r\n			&lt;td&gt;Container Carrying&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;4&lt;/td&gt;\r\n			&lt;td&gt;Sum Insured&lt;/td&gt;\r\n			&lt;td&gt;Invoice value&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;Additional/Tolerance Limit: 5% to 10% of IV + (as mentioned in L/C)&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;Incidental Cost: 10% to 25% of IV= freight charge, insurance charge,&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;anticipated profit etc. (as required by the customer&amp;#39;s need)&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;5&lt;/td&gt;\r\n			&lt;td&gt;Additional Risks&lt;/td&gt;\r\n			&lt;td&gt;Minimum Risk&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;Basic Risk&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;Water Damage &amp;amp; Others&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;All Risk&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;Theft, Pilferage &amp;amp; Non-delivery (TPND)&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;War&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;Strike, Riot &amp;amp; Civil Commotion (SRCC)&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;6&lt;/td&gt;\r\n			&lt;td&gt;Others&lt;/td&gt;\r\n			&lt;td&gt;Signature, KYC, etc.&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n	&lt;/tbody&gt;\r\n&lt;/table&gt;\r\n\r\n&lt;p&gt;Please contact us for more detail.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;!--StartFragment--&gt;&lt;strong&gt;Started from 1st December 1993&lt;/strong&gt;&lt;!--EndFragment--&gt;&lt;/p&gt;\r\n', '', 'Published', 'Allow', 2, 'marine-cargo-insurance', 4, 'Public', '', 0, '/insurance-in-nepal/upload/images/marine.png'),
(19, 18, '2015-10-02 06:19:17', 'Micro Insurance', '&lt;p&gt;Mirco Finance Institutions &amp;nbsp;have been focusing on providing savings and credit services only. However, a growing number of Mirco Finance Institutions practitioners have recognized that providing credit is not enough for the sustainable development of the poor.&lt;/p&gt;\r\n\r\n&lt;p&gt;A heartfelt requirement for other financial activities like insurance and allied services alongside savings and credit services have been noticed.&lt;/p&gt;\r\n\r\n&lt;p&gt;Formal insurance services are not accessible to the poor because of high premiums and complicated procedures.&lt;/p&gt;\r\n\r\n&lt;p&gt;The poor in Nepal like any other less-developed countries are vulnerable to different types of risks and adopt various strategies to reduce the impact of the loss. Insurance services are very essential for the low-income households to cope with uncertainties and emergencies like illness or injury, death, natural disasters, theft and life cycle needs.&lt;/p&gt;\r\n\r\n&lt;p&gt;Micro-insurance helps the poor combat the vulnerability caused by exposure to such unacceptable risks. By pooling into a risk fund to mitigate stipulated perils like illness, loss of assets, death and widowhood, the poor can protect themselves from unexpected loss. Thus, Insurance of lives and livelihoods is important for the risk-prone economic life of the poor.&lt;/p&gt;\r\n\r\n&lt;p&gt;UIC provides Microinsurance under following categories:&lt;br /&gt;\r\n- Birds&lt;br /&gt;\r\n- Cattle&lt;br /&gt;\r\n- Crop&lt;br /&gt;\r\n- Fish&lt;br /&gt;\r\n- Fruits&lt;br /&gt;\r\n- Tarkari Bari&lt;br /&gt;\r\n- Potato&lt;br /&gt;\r\n- Mushroom&lt;br /&gt;\r\n- Honey Bee&lt;br /&gt;\r\n- Ostrich&lt;br /&gt;\r\n- Micro Household&lt;br /&gt;\r\n- Micro Health&lt;br /&gt;\r\n- Micro Personal Accident&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;!--StartFragment--&gt;&lt;strong&gt;Started from 20th May 2014&lt;/strong&gt;&lt;!--EndFragment--&gt;&lt;/p&gt;\r\n', '', 'Published', 'Allow', 2, 'micro-insurance', 7, 'Public', '', 0, '/insurance-in-nepal/upload/images/mi1.jpg'),
(26, 18, '2015-10-02 06:31:48', 'Engineering Insurance', '&lt;p&gt;This insurance caters to the need of projects which predominantly involves civil work like construction of multi storied buildings, dams, bridges, hydropower projects, plant and machinery etc.. The system of Engineering Insurance depends on its success on a proper assessment of the probability of the occurrences of various risks to which the plant and machinery connected with project are exposed &amp;nbsp;constanly &amp;nbsp;and which may cause severe loss or damage to property with various adverse effects on the society as a whole.&lt;/p&gt;\r\n\r\n&lt;p&gt;-Contractor&amp;#39;s All Risk&lt;br /&gt;\r\n-Contractor&amp;#39;s Plant and &lt;!--StartFragment--&gt;Machinery&lt;!--EndFragment--&gt;&lt;br /&gt;\r\n-Boiler and Pressure Plant&lt;br /&gt;\r\n-Erection All Risk&lt;br /&gt;\r\n-&lt;!--StartFragment--&gt;Machinery&lt;!--EndFragment--&gt;&lt;br /&gt;\r\n-Marine Cum Erection&lt;br /&gt;\r\n-Electronic Equipment&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;!--StartFragment--&gt;&lt;strong&gt;Started from 1st December 1993&lt;/strong&gt;&lt;!--EndFragment--&gt;&lt;/p&gt;\r\n', '', 'Published', 'Allow', 2, 'engineering-insurance', 6, 'Public', '', 0, '/insurance-in-nepal/upload/images/engineering.jpg'),
(33, 18, '2015-10-04 08:08:10', 'Miscellaneous Insurance', '&lt;p&gt;&lt;strong&gt;Personal Accident Insurance &lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;This Policy covers financial loss that may arise as a result of accident caused by external violent and visible means causing death or disablement by bodily injury. &amp;nbsp;In the case of Comprehensive Personal Accident Insurance it covers Temporary Total Disablement and Medical Expenses up to fixed limits. &amp;nbsp;Besides, the Policy is extended to cover the risk of Trekking, Mountaineering, Expeditions, Rafting, Commercial Flights, etc. &amp;nbsp;However, this policy does not cover the chartered flights.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Cash in Transit Insurance&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;This Policy cover provides an indemnity in respect of loss of money carried by authorized messengers whilst in transit from one to another, specified in the Policy due to robbery, loss caused by the accident of vehicle and airplane. &amp;nbsp;This insurance is intended for Banks, Industrial, Manufacturing and other business concern who periodically withdraw large sums of money for payments of salaries and for other day - to day transactions from banks or other sources.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\n&lt;strong&gt;Burglary &amp;amp; House - Breaking Insurance &lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;This insurance is intended to cover contents of premises against loss or damage by burglary and/ or house- breaking. &amp;nbsp;Here the Burglary and House- Breaking are defined as theft, involving entry to or exit from the insured premises by forcible and violent means. &amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\n&lt;strong&gt;Fidelity Guarantee Insurance &lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;This insurance is intended to provide an indemnity to the employer for financial loss sustained as a result of forgery, embezzlement, and larceny or fraudulent conversion of money of the employer committed by salaried employees in the course of performance of their duties. &amp;nbsp;The maximum liability under the policy will be the amount of guarantee.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Banker&amp;#39;s Indemnity Insurance &lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;This insurance provides an indemnity to the Bank in respect of the following risks:&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:49.7pt&quot;&gt;a. Loss of money or securities by fire, riot and strike, burglary house breaking theft, robbery or hold-up;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:49.7pt&quot;&gt;b. Loss of money or securities in transit;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:49.7pt&quot;&gt;c. Payment on forged or raised cheques, drafts and fixed deposit receipts;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:49.7pt&quot;&gt;d. Dishonest Acts of employees in respect of money and securities; and &amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:49.5pt&quot;&gt;e. Dishonest Acts of employees in respect of pledged goods.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:49.5pt&quot;&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;International Travelers Medi-claim Insurance&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;In view of the increasing need of medical insurance for Nepalese going abroad, UICL has introduced &amp;quot;International Medi-claim Policy&amp;quot; with wide coverage of personal accidents at moderate premium rate for medical emergency expenses, hospital expenses, loss of checked baggage, passport and third party liability.&lt;/p&gt;\r\n\r\n&lt;p&gt;The Policy could also be procured by the students going abroad for further education.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Group cum Family Hospitalization Insurance&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;This insurance is intended to provide benefit by way of reimbursement of expenses incurred by the insured towards hospitalization including accommodation and nursing attendance, fees for surgeons and other special service. &amp;nbsp;Domiciliary/ Hospitalization. I.e. treatment normally requiring hospitalization but where proper treatment is received at home, the same is also covered by this policy. &amp;nbsp;This policy is designed for requirement of hospitalization insurance for both corporate &amp;amp; general public. &amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;!--StartFragment--&gt;&lt;strong&gt;Started from 1st December 1993&lt;/strong&gt;&lt;!--EndFragment--&gt;&lt;/p&gt;\r\n', '', 'Published', 'Allow', 2, 'miscellaneous-insurance', 5, 'Public', '', 0, '/insurance-in-nepal/upload/images/misc.jpg'),
