(77, 18, '2015-10-05 09:40:16', 'नागरिक बडापत्र', '&lt;table border=&quot;0&quot; cellpadding=&quot;0&quot; cellspacing=&quot;0&quot; class=&quot;table table-bordered table-hover table-striped&quot; id=&quot;bluetbl&quot; style=&quot;width:100%&quot;&gt;\r\n	&lt;tbody&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;&lt;strong&gt;कम्पनीका सेवाहरु&lt;/strong&gt;&lt;/td&gt;\r\n			&lt;td&gt;निर्जीवन बीमा सम्बन्धित सबै सेवाहरू।&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;&lt;strong&gt;सम्बन्धित नियम र कानून&lt;/strong&gt;&lt;/td&gt;\r\n			&lt;td&gt;कम्पनी ऐन २०६३; बीमा ऐन २०४९; बीमा नियमावली २०४९; &amp;nbsp;र अन्य Beema समिति द्वारा जारी नियम र विनियम परिपत्र सहित कानून र प्रेरित, सम्बन्धित।&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;\r\n			&lt;p&gt;​&lt;strong&gt;अन्डरराइटिङ&lt;/strong&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n			&lt;ol&gt;\r\n			&lt;/ol&gt;\r\n			&lt;/td&gt;\r\n			&lt;td&gt;\r\n			&lt;p&gt;सबै बीमाको लागि तपाईंको ग्राहक (KYC) फारम संग नागरिकता को फोटो कपी, एक pp size &amp;nbsp;फोटो, PAN / पंजीकरण कागज हुनुपर्छ ।&lt;/p&gt;\r\n\r\n			&lt;p&gt;&lt;strong&gt;बीमालेख तयार पार्न चाहिने कागजपत्रहरू&lt;/strong&gt;&lt;/p&gt;\r\n\r\n			&lt;ol&gt;\r\n				&lt;li&gt;सबै प्रकारका बीमालेखहरू: प्रस्ताव फारम&lt;/li&gt;\r\n				&lt;li&gt;सवारी साधन बीमा: &amp;nbsp;सवारी साधन दर्ता पुस्तिका (ब्लु बुक)को फोटोकपी र बिगतका बीमा कम्पनीले दिएको नविकरण सुचना&lt;/li&gt;\r\n				&lt;li&gt;सामुद्रिक बीमा: &amp;nbsp;प्रतित पत्र, लदान पत्र, विजक, पूर्व विजक, चलान आदि&lt;/li&gt;\r\n				&lt;li&gt;ठेकेदारको सम्पूर्ण जोखिम बीमा: &amp;nbsp;ठेकेदारको मालिकसित भएको करारनामा, गर्नु पर्ने कामको&amp;nbsp;विवरण (BOQ)&lt;/li&gt;\r\n				&lt;li&gt;विदेश यात्रा बीमा: &amp;nbsp;पासपोर्टको फोटोकपी&lt;/li&gt;\r\n				&lt;li&gt;अन्य बीमालेखको लागि : &amp;nbsp;कम्पनीको माग बमोजिम अन्य कागजातहरू&lt;/li&gt;\r\n			&lt;/ol&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;&lt;strong&gt;बीमा नीति तयार गर्न आवश्यक&amp;nbsp;समय&lt;/strong&gt;&lt;/td&gt;\r\n			&lt;td&gt;बीमाको लागि चाहिने सम्पूर्ण जानकारी र आवश्यक&amp;nbsp;कागजपत्रहरू प्राप्त भएपछि अधिकतम एक घण्टा&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;&lt;strong&gt;प्रीमियम (शुल्क) भुक्तानी&lt;/strong&gt;&lt;/td&gt;\r\n			&lt;td&gt;बीमालेख/कर &amp;ndash; विजकमा उल्लेख भएको बीमाशुल्क; टिकट &amp;nbsp;दस्तुर तथा मू.अ.क.को जम्मा रकम।&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;&lt;strong&gt;नविकरण सूचना&lt;/strong&gt;&lt;/td&gt;\r\n			&lt;td&gt;एक वर्ष बीमा अवधि हुने बीमालेखहरूको लागि कम्पनीले सम्बन्धित &amp;nbsp;बीमालेखको अवधि समाप्त हुनु भन्दा एक महिना अघि नविकरण सूचना &amp;nbsp;&amp;nbsp;पठाइन्छ।&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;&lt;strong&gt;अन्डरराइटिङ &amp;nbsp;सम्बन्धित शिकायत&lt;/strong&gt;&lt;/td&gt;\r\n			&lt;td&gt;कम्पनी मुख्य कार्यालयमा&lt;br /&gt;\r\n			&amp;nbsp; &amp;nbsp; &amp;nbsp;पहिलो &amp;nbsp;: श्री &lt;!--StartFragment--&gt;दिबस तिमल्सेना,सहायक प्रबन्धक&lt;!--EndFragment--&gt;&amp;nbsp;&lt;br /&gt;\r\n			&amp;nbsp; &amp;nbsp; &amp;nbsp; दोस्रो &amp;nbsp; : &lt;!--StartFragment--&gt;श्री बिष्णु प्रसाद सुबेदी&lt;!--EndFragment--&gt;, &lt;!--StartFragment--&gt;सहायक महाप्रबन्धक&lt;!--EndFragment--&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;&lt;strong&gt;बीमा दावी कहाँ गर्ने&lt;/strong&gt;&lt;/td&gt;\r\n			&lt;td&gt;दावी शाखा &amp;ndash; कम्पनीको प्रधान कार्यालय लगायत कम्पनीका कुनै पनि शाखा कार्यालयहरूमा वा uic@mail.com.np मा ईमेल पठाएर।&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;&lt;strong&gt;दावी फर्छ्यौट हुन लाग्ने समय &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/strong&gt;&lt;/td&gt;\r\n			&lt;td&gt;सर्भेयरको प्रतिवेदन प्राप्त भएपछि अथवा आवश्यक&amp;nbsp;सम्पूर्ण कागजपत्रहरू प्राप्त भएपछि प्राप्त पछि दुई सप्ताह भित्र।&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;&lt;strong&gt;दाबी सम्बन्धित शिकायत&lt;/strong&gt;&lt;/td&gt;\r\n			&lt;td&gt;कम्पनी प्रधान कार्यालय मा श्री प्रशान्त राज न्यौपाने,सहायक प्रबन्धक&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;&lt;strong&gt;शेयर&lt;/strong&gt;&lt;/td&gt;\r\n			&lt;td&gt;कम्पनीका शेयर रजिष्ट्रार सम्बन्धी कार्यहरू&amp;nbsp;&amp;nbsp; M/S. Global IME Capital Market, Jamal, Kathmandu.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;&lt;strong&gt;उजुरी/गुनासो&lt;/strong&gt;&lt;/td&gt;\r\n			&lt;td&gt;कम्पनी प्रधान कार्यालय मा&amp;nbsp;श्री बिदुर&amp;nbsp;&amp;nbsp;बहादुर भुजेल&lt;!--EndFragment--&gt;, &lt;!--StartFragment--&gt;कम्पनी सचिब&lt;!--EndFragment--&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n	&lt;/tbody&gt;\r\n&lt;/table&gt;\r\n', '', 'Published', 'Allow', 12, '5c5683191eef1', 6, 'Public', '', 0, ''),
