(79, 18, '2015-10-05 09:43:26', 'अग्नि बीमा', '&lt;p&gt;&lt;strong&gt;अग्नि तथा सम्बद्ध जोखिम बीमा&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;अग्नि बीमा कुनै पनी मूल्य भएको चल र अचल सम्पत्तिमा लागु हुन्छ । उदाहरणको लागि भवन, कारखाना, मशीनरी, फर्नीचर, फिक्स्चर र फिटिंग, घरेलू&lt;br /&gt;\r\nसामान, स्टक र व्यापार आदि।&lt;/p&gt;\r\n\r\n&lt;p&gt;अग्नि पलिसीले निम्न थप जोखिम कवर गर्न सक्छ:&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;भूकम्प (अग्नि र कम्पन)&amp;nbsp;&lt;/li&gt;\r\n	&lt;li&gt;तूफान, Tempest, बाढी र Inundation.&lt;/li&gt;\r\n	&lt;li&gt;विमान क्षति वा विमान बाट झरेको सामान&lt;/li&gt;\r\n	&lt;li&gt;विस्फोटन&lt;/li&gt;\r\n	&lt;li&gt;भूमि स्लाइड&lt;/li&gt;\r\n	&lt;li&gt;Riot / स्ट्राइक क्षति&lt;/li&gt;\r\n	&lt;li&gt;खराब नियत बाट गरिएको क्षति&lt;/li&gt;\r\n	&lt;li&gt;बिधोम्स आतंकवाद&lt;/li&gt;\r\n	&lt;li&gt;Impact क्षति&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;table class=&quot;table&quot;&gt;\r\n	&lt;thead&gt;\r\n		&lt;tr&gt;\r\n			&lt;th&gt;सि.नं.&lt;/th&gt;\r\n			&lt;th&gt;शिर्षक&lt;/th&gt;\r\n			&lt;th&gt;विवरण&lt;/th&gt;\r\n		&lt;/tr&gt;\r\n	&lt;/thead&gt;\r\n	&lt;tbody&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;१&lt;/td&gt;\r\n			&lt;td&gt;प्रस्तावित सम्पत्ति&lt;/td&gt;\r\n			&lt;td&gt;भवन तथा संलग्न मालसामान वा मेशिनरीहरु&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;२&lt;/td&gt;\r\n			&lt;td&gt;स्थान&lt;/td&gt;\r\n			&lt;td&gt;गांउ/नगर, वडा नं., जिल्ला/क्षेत्र, कित्ता नं., घर नं.,चार किल्ला&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;३&lt;/td&gt;\r\n			&lt;td&gt;भवनको उपयोग&lt;/td&gt;\r\n			&lt;td&gt;घरायसी, व्यवसायिक/पसल, उद्योग/कारखाना, गोदाम&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;४&lt;/td&gt;\r\n			&lt;td&gt;बीमान्क रकम&lt;/td&gt;\r\n			&lt;td&gt;बीमितको मूल्य, बजार मूल्य मूल्यांकन गरे अनुसार, ऋण प्रदान गरेको मूल्य&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;५&lt;/td&gt;\r\n			&lt;td&gt;बीमाशुल्कमा छुट&lt;/td&gt;\r\n			&lt;td&gt;संस्थागत/व्यक्तिगत छुट , अग्नि नियन्त्रण यन्त्र जडान गरे वापत छुट&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;६&lt;/td&gt;\r\n			&lt;td&gt;अतिरिक्त जोखिम&lt;/td&gt;\r\n			&lt;td&gt;हुलदंगा र हडताल, आतंकबाद, द्वेषपुर्णकार्य&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;६&lt;/td&gt;\r\n			&lt;td&gt;अन्य&lt;/td&gt;\r\n			&lt;td&gt;तल्ला, बनावट, निर्माण गर्न उपयोग गरिएका सामाग्री, बहन गरिने जोखिम, छुट , अनिवार्य अधिक, हस्ताक्षर/कार्यालय छाप,&amp;nbsp;&amp;nbsp; &amp;nbsp;केवाइसि&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n	&lt;/tbody&gt;\r\n&lt;/table&gt;\r\n\r\n&lt;h2&gt;गार्हस्थ बीमा&lt;/h2&gt;\r\n\r\n&lt;p&gt;यस बीमा अन्तर्गत UIC ले अतिरिक्त प्रिमियम बिना नै &amp;nbsp;निजी बासस्थान घर र यसका सामग्रीहरूको हानि वा क्षतिको बिमितलाई बीमा गर्दछ।&amp;nbsp;&lt;br /&gt;\r\nयो बीमा को मुख्य उद्देश्य भनेको सर्विस होल्डर हरुको आरसीसी/ आरबीसी बाट निर्माण गरिएको आवासीय भवनको बीमा गर्नु हो। यो बीमा अन्तर्गत 40,00,000 सम्मको बीमा निम्न रिस्कहरुको लागि गरिन्छ।&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;अग्नि, चट्याड़, घरेलु उपकरण को विस्फोटन, भूकम्प&lt;/li&gt;\r\n	&lt;li&gt;तूफान, जलप्रलय&lt;/li&gt;\r\n	&lt;li&gt;Subsidence र पहिरो&amp;nbsp;&lt;/li&gt;\r\n	&lt;li&gt;Riot / स्ट्राइक क्षति&lt;/li&gt;\r\n	&lt;li&gt;खराब नियत बाट गरिएको क्षति र आतंकवाद&lt;/li&gt;\r\n	&lt;li&gt;विमान क्षति वा विमान बाट झरेको सामान&lt;/li&gt;\r\n	&lt;li&gt;चोरी&lt;/li&gt;\r\n	&lt;li&gt;गाडी वा पशुको ठक्कर बाट भएको क्षेती&amp;nbsp;&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;h3&gt;&lt;strong&gt;जारी मिति: १६ मंशिर २०५०&lt;/strong&gt;&lt;/h3&gt;\r\n', '', 'Published', 'Allow', 13, '5a6ebd17f2564', 1, 'Public', '', 0, '/insurance-in-nepal/upload/images/fire.png'),
(80, 18, '2015-10-05 09:44:05', 'सवारी साधन बीमा', '&lt;p&gt;यूनाइटेड इन्स्योरेन्स कं. (नेपाल) लि. का यस् बीमा मा &amp;nbsp;दुई प्रकारका नीतिहरू छन ।&amp;nbsp;&lt;br /&gt;\r\n&lt;br /&gt;\r\n१.&amp;nbsp;(i) व्यापक बीमा - यस् अन्तरगत सबारी साधन मा भएको कुनै हानि वा क्षति &amp;nbsp;पर्दछ ।&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:40px&quot;&gt;(क) आकस्मिक बाह्य दुर्घटना&amp;nbsp;&lt;br /&gt;\r\n(ख) आगो, बाह्य विस्फोट, आत्म-ज्वलन, बिजुली, चोरी, र चोरी।&lt;br /&gt;\r\n(ग) खराब नियत बाट गरिएको क्षति&lt;br /&gt;\r\n(घ) सडक, रेल, अंतर्देशीय जलमार्ग, लिफ्ट वा elevator द्वारा ट्रान्जिट मा सिमित भएमा&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;(ii) तेस्रो पक्ष दायित्वको जोखिम समेत बीमा गर्न सकिन्छ ।&lt;/p&gt;\r\n\r\n&lt;p&gt;२. यस् नीति अन्तर्गत बाढी, भूकम्प, हडताल, Riot आदि जस्ता क्षति &amp;nbsp;को लागि अतिरिक्त &amp;nbsp;&amp;nbsp; &amp;nbsp;प्रिमियम को भुक्तानी गरिन्छ।&lt;br /&gt;\r\n&amp;nbsp;&amp;nbsp; &amp;nbsp;- मोटरसाइकल&lt;br /&gt;\r\n&amp;nbsp;&amp;nbsp; &amp;nbsp;- निजी सवारी साधन&lt;br /&gt;\r\n&amp;nbsp;&amp;nbsp; -&amp;nbsp;सार्वजनिक&amp;nbsp;सवारी साधन&lt;/p&gt;\r\n\r\n&lt;table class=&quot;table&quot;&gt;\r\n	&lt;thead&gt;\r\n		&lt;tr&gt;\r\n			&lt;th&gt;सि.नं.&lt;/th&gt;\r\n			&lt;th&gt;शिर्षक&lt;/th&gt;\r\n			&lt;th&gt;विवरण&lt;/th&gt;\r\n		&lt;/tr&gt;\r\n	&lt;/thead&gt;\r\n	&lt;tbody&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;१&lt;/td&gt;\r\n			&lt;td&gt;प्रस्तावित सम्पति&lt;/td&gt;\r\n			&lt;td&gt;मोटर साइकल, निजि कार, व्यवसायिक सवारी साधनहरु&amp;nbsp;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;२&lt;/td&gt;\r\n			&lt;td&gt;सवारीको विवरण&lt;/td&gt;\r\n			&lt;td&gt;सि.सि., हर्षपावर, टन, च्यासिस नं., इन्जीन नं., दर्ता नं.,&amp;nbsp;बनेको वर्ष, बनोट, मोडल&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;३&lt;/td&gt;\r\n			&lt;td&gt;बिमान्क&amp;nbsp;रकम&lt;/td&gt;\r\n			&lt;td&gt;शोरुम मूल्य नयां सवारी साधनको लागि / बर्तमान बजार मूल्यको&amp;nbsp;&amp;nbsp;आधारमा ह्रास कट्टी मूल्य बीमा समिति निर्देशिका अनुसार&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;४&lt;/td&gt;\r\n			&lt;td&gt;छुट&lt;/td&gt;\r\n			&lt;td&gt;संस्थागत / व्यक्तिगत&amp;nbsp;&amp;nbsp; &amp;nbsp;&amp;nbsp;&amp;nbsp; &amp;nbsp;&lt;br /&gt;\r\n			स्वयं व्यहोरिने अधिक क्षति, दावी नगरे वापत प्राप्त हुने छुट,&amp;nbsp;&amp;nbsp; &amp;nbsp;&amp;nbsp;&amp;nbsp; &amp;nbsp;&lt;br /&gt;\r\n			निजि सामान ढुवानी गरे वापत पाउने छुट &amp;nbsp;&amp;nbsp; &amp;nbsp;&amp;nbsp;&amp;nbsp; &amp;nbsp;&lt;br /&gt;\r\n			व्यवसायिक सवारी साधनमा&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;५&lt;/td&gt;\r\n			&lt;td&gt;अतिरिक्त जोखिम&lt;/td&gt;\r\n			&lt;td&gt;हुलदंगा र हडताल, आतंकबाद, द्वेषपुर्णकार्य, चालक, यात्रु&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;६&lt;/td&gt;\r\n			&lt;td&gt;अन्य&lt;/td&gt;\r\n			&lt;td&gt;हस्ताक्षर / कार्यालय छाप, के वाइ सि&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n	&lt;/tbody&gt;\r\n&lt;/table&gt;\r\n\r\n&lt;h3&gt;&lt;!--StartFragment--&gt;&lt;strong&gt;जारी मिति: १६ मंशिर २०५०&lt;/strong&gt;&lt;!--EndFragment--&gt;&amp;nbsp;&lt;/h3&gt;\r\n', '', 'Published', 'Allow', 13, '5a6eb6334da9a', 2, 'Public', '', 0, '/insurance-in-nepal/upload/images/motorinsurance.jpg'),
(81, 18, '2015-10-05 09:45:10', 'सामुद्रिक बीमा', '&lt;p&gt;सामुद्रिक बीमाले निकासी पैठारीको दौरानमा हुने हानी नोक्सानीकोबाट आर्थिक राहत प्रदान गरी व्यापरमा सुनिश्चितता ल्याउछ। UIC&amp;nbsp;ले जहाज, एयर, रेल वा रोड द्वारा गरिने ट्रान्जिट मा समुद्री कार्गो बीमा प्रदान गर्दछ।&lt;br /&gt;\r\n- समुद्री कार्गो&lt;br /&gt;\r\n- अंतर्देशीय ट्रान्जिट&lt;br /&gt;\r\n- बैदेशिक&amp;nbsp;ट्रान्जिट&lt;br /&gt;\r\n- एयर&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;h3&gt;&lt;!--StartFragment--&gt;&lt;strong&gt;जारी मिति: १६ मंशिर २०५०&lt;/strong&gt;&lt;!--EndFragment--&gt;&lt;/h3&gt;\r\n', '', 'Published', 'Allow', 13, '5a6eb6494e876', 3, 'Public', '', 0, '/insurance-in-nepal/upload/images/marine.png'),
(82, 18, '2015-10-05 09:45:54', 'विविध बीमा ', '&lt;p&gt;व्यक्तिगत दुर्घटना बीमा&lt;/p&gt;\r\n\r\n&lt;p&gt;यो नीतिले वित्तीय हिसाबले समावेश गर्दछ जुन बाह्य हिंसात्मक र दृष्टान्तको कारणले गर्दा दुर्घटनाको कारण उत्पन्न हुन सक्छ जसले शारीरिक चोटले मृत्यु वा असक्षम गराउँछ। व्यापक व्यक्तिगत दुर्घटना बीमाको अवस्थामा यसले अस्थायी कुल असक्षमता र मेडिकल व्ययहरू निश्चित सीमामा समावेश गर्दछ। साथै, नीति ट्रेकिंग, पर्वतारोहण, अभियान, राफ्टिंग, व्यावसायिक उडान, आदि को जोखिम को कवर गर्न को लागी विस्तार गरिन्छ। यद्यपि, यस नीतिले चार्टर्ड उडानहरू समावेश गर्दैन।&lt;/p&gt;\r\n\r\n&lt;p&gt;नगद &amp;nbsp;बीमालेख&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;यो नीति आवरणले अधिकृत दूतहरु द्वारा लिइएको पैसा हानिको सन्दर्भमा क्षतिपूर्ति प्रदान गर्दछ जब नीतिमा उल्लिखित, वाहन र विमानस्थलको दुर्घटनाको कारणले गर्दा नीति मा निर्दिष्ट गरिन्छ। यो बीमा बैंक, औद्योगिक, विनिर्माण र अन्य व्यवसायिक चिन्ताको उद्देश्य हो जुन जसले समय-समयमा वेतन र अन्य दिनको लागि भुक्तानीको ठूलो रकम फिर्ता गर्छ - बैंकिङ वा अन्य स्रोतहरूबाट दिनको लेनदेनको।&lt;/p&gt;\r\n\r\n&lt;p&gt;सेधमारी तथा नकवजनी बीमा&lt;/p&gt;\r\n\r\n&lt;p&gt;यो बीमा उद्देश्यले चोरी वा / वा घर-तोड्नेले हानि वा क्षतिको विरुद्ध परिसरका सामग्रीहरू समाविष्कार गर्ने उद्देश्य राख्दछ। यहाँ चोरी र घर-ब्रेकिंग चोरीको रुपमा परिभाषित गरिएको छ, समावेशी वा हिंसक र हिंसात्मक माध्यमद्वारा बीमा गरिएको परिसरबाट निस्कन वा बाहिर निस्कन्छ।&lt;/p&gt;\r\n\r\n&lt;p&gt;निष्ठा जमानि बीमालेख&lt;/p&gt;\r\n\r\n&lt;p&gt;यो बीमा उद्देश्यले आफ्नो कर्तव्यको प्रदर्शनमा सापेक्षित कर्मचारियों द्वारा प्रतिबद्ध नियोक्ता को रकम को भूल, भ्रष्टाचार र धोखाधड़ी या धोखाधड़ी को परिणामस्वरूप को रूप मा निरन्तर वित्तीय हानि को लागि क्षतिपूर्ति प्रदान गर्ने उद्देश्य हो। नीति अन्तर्गत अधिकतम दायित्व ग्यारेन्टी रकम हुनेछ।&lt;/p&gt;\r\n\r\n&lt;p&gt;बैंकरको क्षतिपूर्ति बीमा&lt;/p&gt;\r\n\r\n&lt;p&gt;यस बीमाले निम्न जोखिमको सन्दर्भमा बैंकलाई क्षतिपूर्ति प्रदान गर्दछ:&lt;/p&gt;\r\n\r\n&lt;p&gt;-&amp;nbsp; आगो, दंगा र हड्तालले पैसा वा प्रतिभूतता, चोरी चोरी चोरी चोरी, लुटपाट वा होल्ड अप;&lt;/p&gt;\r\n\r\n&lt;p&gt;-&amp;nbsp; पारगमनमा पैसा वा प्रतिभूतता हानि;&lt;/p&gt;\r\n\r\n&lt;p&gt;-&amp;nbsp; जाली वा उठाएका चेकहरू, ड्राफ्टहरू र निश्चित जम्मा रकमहरूमा भुक्तानी;&lt;/p&gt;\r\n\r\n&lt;p&gt;-&amp;nbsp; पैसा र प्रतिभूतिको सम्बन्धमा कर्मचारियोंका तिब्बती कार्यहरू; र&lt;/p&gt;\r\n\r\n&lt;p&gt;-&amp;nbsp; प्रतिज्ञा गरिएका सामानको सम्बन्धमा कर्मचारीहरूको बेईमानी कार्यहरू।&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;अन्तर्राष्ट्रिय यात्रीहरूको मेडी-क्लेम&amp;nbsp; बीमा&lt;/p&gt;\r\n\r\n&lt;p&gt;विदेश जाने नेपालीहरूको स्वास्थ्य बीमाको बढ्दो आवश्यकताको अवलोकनमा यूआईसीएलले &amp;quot;अन्तर्राष्ट्रिय मेडी-क्लेम नीति&amp;quot; परिचय गरेको छ जुन व्यक्तिगत आम्दानी दरको बिजुली कवरेजले चिकित्सा आकस्मिक खर्चको लागि अस्पताल, अस्पतालको खर्च, जाँच गरिएको सामानको क्षति, पासपोर्ट र तेस्रोको क्षति पुर्याएको छ। पार्टी जिम्मेवारी।&lt;/p&gt;\r\n\r\n&lt;p&gt;नीति पनि विद्यार्थीहरुलाई थप शिक्षाको लागि जाँदै विद्यार्थी द्वारा खरीद गर्न सकिन्छ।&lt;/p&gt;\r\n\r\n&lt;p&gt;सामुहिक परिवार अस्पताल बीमा&lt;/p&gt;\r\n\r\n&lt;p&gt;यो बीमा उद्देश्य र नर्सिङ उपस्थिति, सर्जनहरूको लागि शुल्क र अन्य विशेष सेवा सहित अस्पताल भर्तीमा बीमा द्वारा खर्च को खर्च को माध्यम ले लाभ प्रदान गर्न को लागी छ। Domiciliary / Hospitalization। I.e. उपचार सामान्य रूपमा अस्पतालको आवश्यकता छ तर घरमा उचित उपचार प्राप्त भएको छ, यो पनि यस नीतिले ढाकेको छ। यो नीति अस्पताल अस्पतालको आवश्यकताको लागि डिजाइन गरिएको छ&lt;/p&gt;\r\n\r\n&lt;h3&gt;&lt;strong&gt;जारी मिति: १६ मंशिर २०५०&lt;/strong&gt;&lt;/h3&gt;\r\n\r\n&lt;p&gt;&lt;!--EndFragment--&gt;&lt;/p&gt;\r\n', '', 'Published', 'Allow', 13, '5a6ebcd9e1426', 4, 'Public', '', 0, '/insurance-in-nepal/upload/images/misc.jpg'),
(83, 18, '2015-10-05 09:46:53', 'ईन्जिनियरिङ बीमा', '&lt;p&gt;यस बीमाले परियोजनाहरूको आवश्यकतालाई पूरा गर्दछ जुन मुख्यतः सिविल कामहरू जस्तै बहु भण्डारण इमारतहरू, बांधहरू, पुलहरू, जलविद्युत् परियोजनाहरू, रोपनी र मशीनरी आदि निर्माण गर्दछ। ईन्जिनियरिङ् बीमाको प्रणाली यसको सम्भावनाको उचित मूल्याङ्कनमा निर्भर हुन्छ। विभिन्न जोखिम को घटनाहरु जसलाई संयोजन र मशीनरी संग प्रोजेक्ट जोडिएको छ लगातार निरंतर हुन्छ र जो गंभीर क्षति को कारण हुन सक्छ या यस मा विभिन्न प्रतिकूल प्रभाव संग सम्पत्ति को क्षति हुन सक्छ&lt;/p&gt;\r\n\r\n&lt;p&gt;-Contractor&amp;#39;s All Risk&lt;br /&gt;\r\n-Contractor&amp;#39;s Plant and Machinery&lt;br /&gt;\r\n-Boiler and Pressure Plant&lt;br /&gt;\r\n-Erection All Risk&lt;br /&gt;\r\n-Machinery&lt;br /&gt;\r\n-Marine cum Erection&lt;br /&gt;\r\n-Electronic Equipment&lt;/p&gt;\r\n\r\n&lt;h3&gt;&lt;strong&gt;जारी मिति: १६ मंशिर २०५०&lt;/strong&gt;&lt;/h3&gt;\r\n', '', 'Published', 'Allow', 13, '5a6eb89172cd5', 5, 'Public', '', 0, '/insurance-in-nepal/upload/images/engineering.jpg'),
(84, 18, '2015-10-05 09:47:44', 'माईक्रो बीमा ', '&lt;p&gt;माइक्रो वित्तीय संस्थाहरूद्वारा &amp;nbsp;बचत र क्रेडिट सेवाहरू &amp;nbsp;प्रदानमा मात्र ध्यानकेन्द्रित गरिएको छ। तर, गरिब को दिगो विकासका लागि माइक्रो वित्तीय संस्थाहरूद्वारा गरिने क्रेडिट सेवाहरू मात्र पर्याप्त छैन भन्ने मान्यता छ। बचत र क्रेडिट सेवाहरू सँगसँगै बीमा तथा अन्य वित्तीय गतिविधि र संबद्ध सेवाहरू आवश्यकता &amp;nbsp;छ। उच्च प्रीमियम र जटिल प्रक्रिया को कारण ले गर्दा औपचारिक बीमा सेवाहरू गरिब जनता सम्म पहुंच छैन। कुनै पनि अन्य कम-विकसित देशहरू, जस्तै नेपाल, जोखिम बहन गर्न र विभिन्न प्रकार &amp;nbsp;हानि को प्रभाव कम गर्ने &amp;nbsp;रणनीति अपनाउन स्थिती मा छैनन । कम-आय भएका घरपरिवारले बिरामी वा चोट, मृत्यु, प्राकृतिक प्रकोप, चोरी र जीवन चक्र आवश्यकता, जस्तै अनिश्चितता र आकस्मिक अवस्था, सामना गर्न लागि बीमा सेवाहरू धेरै आवश्यक छन्। रोग, सम्पत्ति को हानि, मृत्यु र विधवा अवस्था जस्ता अनपेक्षित हानि बाट आफूलाई बचाउने काम माइक्रो बीमाले गर्दछ ।&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;UIC ले निम्न &amp;nbsp;विभाग अन्तर्गत माइक्रो बीमा प्रदान &amp;nbsp;गर्दछ:&lt;br /&gt;\r\n- चरा&lt;br /&gt;\r\n- पशु&amp;nbsp;&lt;br /&gt;\r\n- बाली&lt;br /&gt;\r\n- माछा&lt;br /&gt;\r\n- फलफूल&lt;br /&gt;\r\n- तरकारी बारी&lt;br /&gt;\r\n- आलु खेती&lt;br /&gt;\r\n- च्याउ&lt;br /&gt;\r\n- मौरी&lt;br /&gt;\r\n- अस्ट्रीच&amp;nbsp;&lt;br /&gt;\r\n- माईक्रो हाउसहोल्ड&lt;br /&gt;\r\n- माईक्रो हेल्थ&lt;br /&gt;\r\n- माईक्रो व्यक्तिगत दुर्घटना&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;h3&gt;&lt;!--StartFragment--&gt;&lt;strong&gt;जारी मिति: ६ जेष्ठ २०७१&lt;/strong&gt;&lt;!--EndFragment--&gt;&lt;/h3&gt;\r\n', '', 'Published', 'Allow', 13, '5a6eb6d5359ff', 6, 'Public', '', 0, '/insurance-in-nepal/upload/images/mi1.jpg'),
