(132, 18, '2016-12-02 07:04:54', 'यस यूनाइटेड इन्स्योरेन्स कं. (नेपाल) लि.  २४ औं वर्षमा प्रवेश', '&lt;p&gt;यस यूनाइटेड इन्स्योरेन्स कं. (नेपाल) लि. को २४&amp;nbsp;औं वर्षमा प्रवेश गरेको उपलक्ष्यमा कम्पनीको सामाजिक उत्तरदायित्व अन्र्तगत रक्तदान कार्यक्रमका साथै अनाथ बालबालिकाहरुको लागि एक वर्षलाई पुग्ने शैक्षिक स्टेशनरी बालाजु बोहोराटार स्थित एक बाल गृहलाई प्रदान गरियो ।&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;/insurance-in-nepal/upload/images/news/24thani1.jpg&quot; style=&quot;height:600px; width:800px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;/insurance-in-nepal/upload/images/news/24thani2.jpg&quot; /&gt;&lt;/p&gt;\r\n', '', 'Published', 'Allow', 4, '58411da16274c', 1, 'Public', '', 0, ''),
(133, 18, '2016-12-04 10:28:39', 'United Insurance turned 24 - Ratopati.com', '&lt;p&gt;Ratopati.com has published the news about the United insurance&amp;#39;s completion of 23 years in their website.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;a href=&quot;http://www.ratopati.com/news/97722/&quot; target=&quot;_blank&quot;&gt;Click here to read the article&lt;/a&gt;&lt;/p&gt;\r\n', '&lt;p&gt;Ratopati.com has published the news about the United insurance&amp;#39;s completion of 23 years in their website.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;a href=&quot;http://www.ratopati.com/news/97722/&quot; target=&quot;_blank&quot;&gt;Click here to read the article&lt;/a&gt;&lt;/p&gt;\r\n', 'Published', 'Allow', 10, 'united-insurance-turned-24-ratopati-com', 2, 'Public', '', 0, ''),
