(138, 18, '2017-01-09 18:27:44', 'Job Vacancy for Head Office-Marketing', '&lt;p&gt;Vacancy Published Date: 2073.8.3&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;WE ARE HIRING&amp;hellip;..&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;United Insurance Co. (Nepal) Ltd. is a leading national Insurance company invites applications from highly self-motivated and skilled, dynamic and result oriented Nepalese citizen for the following position for Head office.&lt;/p&gt;\r\n\r\n&lt;p&gt;1. Manager: 1 (One) Head Office-Marketing&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Education and Qualification :&amp;nbsp;&amp;nbsp;Masters Degree preferably MBA.&amp;nbsp;&lt;/li&gt;\r\n	&lt;li&gt;Not exceeding 35 years as on date of application&lt;/li&gt;\r\n	&lt;li&gt;Minimum 5 years experience in related field&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;All candidates are expected to be proficient in written /spoken English and Nepali and be complete literate with working knowledge of office applications.&lt;/p&gt;\r\n\r\n&lt;p&gt;Please apply with updated Curriculum Vitae mentioning two reference persons and their respective contact details to the email: uic@mail.com.np&lt;/p&gt;\r\n\r\n&lt;p&gt;No phone calls will be entertained in this regard.&lt;/p&gt;\r\n\r\n&lt;p&gt;No Postal Applications will be accepted.&lt;/p&gt;\r\n\r\n&lt;p&gt;The last date of submission of application will be 7 days from the date of advertisement (within 2073/8/9)&lt;/p&gt;\r\n\r\n&lt;p&gt;Salaries and benefit will be as per company rules. Only shortlisted candidates will be called for an interview. Management reserves the right even to cancel the whole acquisition process without mentioning whatsoever reasons to the all concerned.&lt;/p&gt;\r\n', '&lt;p&gt;United Insurance Co. (Nepal) Ltd. is a leading national Insurance company invites applications from highly self-motivated and skilled, dynamic and result oriented Nepalese citizen for the post of Head Office Marketig. (No. of positions: 1)&lt;/p&gt;\r\n', 'Published', 'Allow', 20, 'job-vacancy-for-head-office-marketing', 12, 'Public', '', 0, '');
