(149, 18, '2017-04-20 10:21:48', 'प्रेस विज्ञप्ती मिती २०७४ बैशाख ७ गते ', '&lt;p style=&quot;text-align: center;&quot;&gt;&lt;img alt=&quot;&quot; src=&quot;/insurance-in-nepal/upload/images/dhurmus.jpg&quot; style=&quot;height:378px; width:536px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;सामाजिक कार्यका अभियान्ता &lt;strong&gt;धुर्मुस&amp;ndash;सुन्तली फाउण्डेशन&lt;/strong&gt;का संस्थापक &lt;strong&gt;श्री सिताराम&amp;nbsp; कट्टेल(धुर्मुस) र श्रीमति कुञ्जना घिमिरे कट्टेल(सुन्तली)&lt;/strong&gt; लाई कम्पनीको ब्राण्ड एम्वेस्डरको रुपमा सहकार्य गर्ने अवसर प्राप्त भएकोमा कट्टेल दम्पतीलाई हार्दिक धन्यवाद सहित यस कम्पनीमा स्वागत गर्दछु । वहाँहरुसंगको सहकार्यले कम्पनीको ब्राण्ड ईमेज तथा बीमा प्रति सर्वसाधारणमा जागरुक गराउन समेत सहयोग पुग्ने विश्वास लिएका छौ ।&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;शेखर बराल&lt;/strong&gt;&lt;br /&gt;\r\nप्रमुख कार्यकारी अधिकृत&amp;nbsp;&lt;br /&gt;\r\nयुनाईटेड इन्स्योरेन्स कं.(नेपाल) लि.&lt;br /&gt;\r\nथापाथली, काठमाण्डौ&amp;nbsp;&lt;/p&gt;\r\n', '&lt;p&gt;सामाजिक कार्यका अभियान्ता &lt;strong&gt;धुर्मुस&amp;ndash;सुन्तली फाउण्डेशन&lt;/strong&gt;का संस्थापक &lt;strong&gt;श्री सिताराम&amp;nbsp; कट्टेल(धुर्मुस) र श्रीमति कुञ्जना घिमिरे कट्टेल(सुन्तली)&lt;/strong&gt; लाई कम्पनीको ब्राण्ड एम्वेस्डरको रुपमा सहकार्य गर्ने अवसर प्राप्त भएकोमा कट्टेल दम्पतीलाई हार्दिक धन्यवाद सहित यस कम्पनीमा स्वागत गर्दछु । वहाँहरुसंगको सहकार्यले कम्पनीको ब्राण्ड ईमेज तथा बीमा प्रति सर्वसाधारणमा जागरुक गराउन समेत सहयोग पुग्ने विश्वास लिएका छौ ।&amp;nbsp;&lt;/p&gt;\r\n', 'Published', 'Allow', 8, '58f892a516afd', 5, 'Public', '', 0, '/insurance-in-nepal/upload/.thumbs/images/dhurmus.jpg'),
