(225, 21, '2019-08-14 10:34:16', 'Claim Forms', '&lt;h1 style=&quot;text-align:center&quot;&gt;&lt;u&gt;Download Claim Forms from here&lt;/u&gt;&lt;/h1&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;h3 style=&quot;text-align:center&quot;&gt;&lt;u&gt;&lt;a href=&quot;/insurance-in-nepal/upload/files/Motor%20ClaimForm_.pdf&quot;&gt;Click here to Download Motor Claim Form&lt;/a&gt;&lt;/u&gt;&lt;/h3&gt;\r\n\r\n&lt;h3&gt;&amp;nbsp;&lt;/h3&gt;\r\n\r\n&lt;h3 style=&quot;text-align:center&quot;&gt;&lt;u&gt;&lt;a href=&quot;/insurance-in-nepal/upload/files/Marine%20ClaimForm.pdf&quot;&gt;Click here to Download Marine&amp;nbsp;Claim Form&lt;/a&gt;&lt;/u&gt;&lt;/h3&gt;\r\n\r\n&lt;h3&gt;&amp;nbsp;&lt;/h3&gt;\r\n\r\n&lt;h3 style=&quot;text-align:center&quot;&gt;&lt;u&gt;&lt;a href=&quot;/insurance-in-nepal/upload/files/Burglary%20ClaimForm.pdf&quot;&gt;Click here to Download Burglary&amp;nbsp;Claim Form&lt;/a&gt;&lt;/u&gt;&lt;/h3&gt;\r\n\r\n&lt;h3&gt;&amp;nbsp;&lt;/h3&gt;\r\n\r\n&lt;h3 style=&quot;text-align:center&quot;&gt;&lt;u&gt;&lt;a href=&quot;/insurance-in-nepal/upload/files/Contractors_All_Risks%20ClaimForm.pdf&quot;&gt;Click here to Download Contractors All Risks&amp;nbsp;Claim Form&lt;/a&gt;&lt;/u&gt;&lt;/h3&gt;\r\n\r\n&lt;h3&gt;&amp;nbsp;&lt;/h3&gt;\r\n\r\n&lt;h3 style=&quot;text-align:center&quot;&gt;&lt;u&gt;&lt;a href=&quot;/insurance-in-nepal/upload/files/FireClaimForm.pdf&quot;&gt;Click here to Download Fire&amp;nbsp;Claim Form&lt;/a&gt;&lt;/u&gt;&lt;/h3&gt;\r\n\r\n&lt;h3&gt;&amp;nbsp;&lt;/h3&gt;\r\n\r\n&lt;h3 style=&quot;text-align:center&quot;&gt;&lt;u&gt;&lt;a href=&quot;/insurance-in-nepal/upload/files/Medical%20ClaimForm.pdf&quot;&gt;Click here to Download Medical&amp;nbsp;Claim Form&lt;/a&gt;&lt;/u&gt;&lt;/h3&gt;\r\n\r\n&lt;h3&gt;&amp;nbsp;&lt;/h3&gt;\r\n\r\n&lt;h3 style=&quot;text-align:center&quot;&gt;&lt;u&gt;&lt;a href=&quot;/insurance-in-nepal/upload/files/Personal%20Accident%20ClaimForm.pdf&quot;&gt;Click here